// *****************************************************************************
// This component displays the Projects I've completed
// Goes to ==> MainSection.js Component 
// *****************************************************************************

import React, { Component } from "react";
import { styled } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import Grid from "@mui/material/Grid";
import Button from "@mui/material/Button";
import Accordion from "@mui/material/Accordion";
import AccordionSummary from "@mui/material/AccordionSummary";
import AccordionDetails from "@mui/material/AccordionDetails";
import Typography from "@mui/material/Typography";
import ExpandMoreIcon from "@mui/icons-material/ExpandMore";
import NavigateNextRoundedIcon from "@mui/icons-material/NavigateNextRounded";
import Image from "mui-image";
import "@fontsource/roboto/300.css";
import "@fontsource/roboto/400.css";
import "@fontsource/roboto/500.css";
import "@fontsource/roboto/700.css";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

class Body extends Component {
  render() {
    return (
      <Box sx={{ flexGrow: 1 }}>
        <Grid
          container
          spacing={2}
          direction="row"
          justifyContent="center"
          alignItems="center"
        >
          {/*//=========== GRID BOX START =================================> */}
          <Grid item xs={11} md={3.5}>
            <Item sx={{ bgcolor: "primary.main", color: "white" }}>
              <Image src={require("../images/Willis_Deluxe_Detail_j.webp")} />
              {/* =============== === ACCORDIAN START === ===================*/}
              <Accordion
                sx={{ bgcolor: "primary.dark", color: "primary.contrastText" }}
              >
                <AccordionSummary
                  expandIcon={
                    <ExpandMoreIcon sx={{ color: "primary.contrastText" }} />
                  }
                  aria-controls="panel1a-content"
                  id="panel1a-header"
                >
                  <Typography>BattleShip Game</Typography>
                </AccordionSummary>
                <AccordionDetails
                  sx={{
                    bgcolor: "secondary.main",
                    color: "primary.contrastText",
                  }}
                >
                  <Typography>
                    This is a battleship game I created using HTML, CSS, and
                    JavaScript. Contains a custom AI to make it more
                    challenging.
                  </Typography>
                  <br />
                  <Button
                    href="https://jeremyduncan.github.io/Battleship/"
                    target="_blank"
                    rel="noopener"
                    variant="contained"
                    endIcon={<NavigateNextRoundedIcon />}
                  >
                    Visit
                  </Button>
                </AccordionDetails>
              </Accordion>
              {/* =============== === ACCORDIAN END === =====================*/}
            </Item>
          </Grid>
          {/*//=========== GRID END =======================================> */}



        </Grid>
      </Box>
    );
  }
}
export default Body;
